import React, { Component } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Like extends Component {
  constructor() {
    super();
    this.state = ["far", "heart"];
  }
  render() {
    return <FontAwesomeIcon icon={["far", "heart"]} />;
  }
}

export default Like;
